import React, { Component } from "react";
import styled from "styled-components";

class Contact extends Component {
  render() {
    const Wrapper = styled.div`
      min-height: 70vh;
    `;
    return <Wrapper>Contact</Wrapper>;
  }
}

export default Contact;
